import React, { useState, useEffect } from "react";
import "./Homepage.css";

export default function HomePage() {
  const [fileUploaded, setFileUploaded] = useState(false);
  const [folderUploaded, setFolderUploaded] = useState(false);
  const [folderContents, setFolderContents] = useState([]);
  const [selectedFiles, setSelectedFiles] = useState([]);
  const [uploadStatus, setUploadStatus] = useState({
    uploaded: false,
    analyzed: false,
    message: "",
    analysisResults: {},
    sensitiveFiles: []
  });
  const [isUploading, setIsUploading] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [fileProgress, setFileProgress] = useState({});
  const [timestamp, setTimestamp] = useState("");

  const CHUNK_SIZE = 1024 * 1024 * 50; // 50MB to match backend

  // Periodically check upload status from backend
  useEffect(() => {
    let statusInterval;
    if (isUploading || isAnalyzing) {
      statusInterval = setInterval(async () => {
        try {
          const response = await fetch("http://localhost:5000/status");
          const statusData = await response.json();
          
          if (statusData.uploaded && !statusData.analyzed && isUploading) {
            setIsUploading(false);
            setIsAnalyzing(true);
          }
          
          if (statusData.analyzed && isAnalyzing) {
            setIsAnalyzing(false);
            setUploadStatus(prev => ({
              ...prev,
              analyzed: true,
              sensitiveFiles: statusData.sensitive_data_files
            }));
          }
        } catch (error) {
          console.error("Error checking status:", error);
        }
      }, 2000);
    }
    
    return () => {
      if (statusInterval) clearInterval(statusInterval);
    };
  }, [isUploading, isAnalyzing]);

  const handleFileUpload = (event) => {
    const files = event.target.files;
    if (files.length > 0) {
      setSelectedFiles(Array.from(files));
      setFileUploaded(true);
      setFolderUploaded(false);
      console.log(`Selected ${files.length} files for upload`);
    }
  };

  const handleFolderUpload = (event) => {
    const files = event.target.files;
    let fileList = [];
    for (let i = 0; i < files.length; i++) {
      if (files[i].name.endsWith(".js") || files[i].name.endsWith(".py")) {
        fileList.push(files[i]);
      }
    }
    if (fileList.length > 0) {
      setSelectedFiles(fileList);
      setFolderUploaded(true);
      setFileUploaded(false);
      setFolderContents(fileList.map(file => file.name));
      console.log(`Selected ${fileList.length} files from folder`);
    } else {
      console.warn("No .js or .py files found in folder");
      alert("Tidak ada file dengan ekstensi .js atau .py yang ditemukan.");
      setFolderUploaded(false);
    }
  };

  const uploadChunk = async (file, start, chunk) => {
    const formData = new FormData();
    formData.append("file", chunk);
    formData.append("start", start);
    formData.append("total_size", file.size);
    formData.append("filename", file.name);

    console.log(`Uploading chunk for ${file.name}: ${start}-${start + chunk.size} of ${file.size}`);

    const response = await fetch("http://localhost:5000/upload-chunk", {
      method: "POST",
      body: formData,
    });

    if (!response.ok) {
      throw new Error(`Upload chunk failed: ${response.statusText}`);
    }
    const result = await response.json();
    console.log(`Chunk upload response:`, result);

    // Update progress for this specific file
    const progress = Math.min(Math.round((start + chunk.size) / file.size * 100), 100);
    setFileProgress((prevProgress) => ({
      ...prevProgress,
      [file.name]: progress,
    }));

    return result;
  };

  

  const analyzeFiles = async () => {
    setIsAnalyzing(true);
    try {
      const response = await fetch("http://localhost:5000/analyze-files", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          timestamp: timestamp
        }),
      });

      if (!response.ok) {
        throw new Error("Failed to analyze files");
      }

      const result = await response.json();
      console.log("Analysis completed:", result);

      setUploadStatus({
        uploaded: true,
        analyzed: true,
        message: "Analysis completed successfully",
        analysisResults: result.results || {},
        sensitiveFiles: result.sensitive_data_files || []
      });

      alert("Analisis selesai!");
    } catch (error) {
      console.error("Analysis error:", error);
      setUploadStatus(prev => ({
        ...prev,
        message: `Analisis gagal: ${error.message}`,
      }));
      alert("Terjadi kesalahan saat menganalisis file.");
    } finally {
      setIsAnalyzing(false);
    }
  };

  const viewAnalysisResult = (filename) => {
    if (uploadStatus.analysisResults[filename]) {
      alert(`Hasil analisis untuk ${filename}:\n\n${uploadStatus.analysisResults[filename]}`);
    } else {
      alert(`Belum ada hasil analisis untuk ${filename}`);
    }
  };

  return (
    <div className="container-homepage">
      <nav className="navbar">HauntAI</nav>
      <div className="upload-container">
        <h2>Upload File or Folder</h2>
        <p className="upload-limit">Maksimum ukuran file: 30GB</p>
        <div className="upload-options">
          <div className="upload-box">
            <label className={`upload-label ${folderUploaded ? "disabled" : ""}`} >
              Upload File
              <input type="file" multiple onChange={handleFileUpload} disabled={folderUploaded || isUploading || isAnalyzing} />
            </label>
          </div>
          <div className="upload-box">
            <label className={`upload-label ${fileUploaded ? "disabled" : ""}`} >
              Upload Folder
              <input type="file" webkitdirectory="" directory="" multiple onChange={handleFolderUpload} disabled={fileUploaded || isUploading || isAnalyzing} />
            </label>
          </div>
        </div>
        <button 
          className="upload-button" 
          onClick={handleUploadToBackend}
          disabled={isUploading || isAnalyzing || selectedFiles.length === 0}
        >
          {isUploading ? "Uploading..." : isAnalyzing ? "Analyzing..." : "Upload"}
        </button>
      </div>

      {selectedFiles.length > 0 && (
        <div className="folder-content-container">
          <h3>File yang Akan Diupload:</h3>
          <ul>
            {selectedFiles.map((file, index) => (
              <li key={index} className="file-item">
                <div className="file-info">
                  <span className="file-name">{file.name}</span>
                  {fileProgress[file.name] !== undefined && (
                    <div className="progress-container">
                      <div className="progress-bar" style={{ width: `${fileProgress[file.name]}%` }}></div>
                      <span className="progress-text">{fileProgress[file.name]}%</span>
                    </div>
                  )}
                </div>
                
                {/* Button untuk lihat hasil analisis */}
                {uploadStatus.analyzed && (
                  <div className="analysis-controls">
                    <button 
                      onClick={() => viewAnalysisResult(file.name)} 
                      className={`analysis-button ${uploadStatus.sensitiveFiles.includes(file.name) ? "sensitive" : ""}`}
                    >
                      Lihat Hasil Analisis
                      {uploadStatus.sensitiveFiles.includes(file.name) && 
                        <span className="sensitive-badge">Sensitif</span>
                      }
                    </button>
                  </div>
                )}
              </li>
            ))}
          </ul>
        </div>
      )}
      
      {/* Status section */}
      {(isUploading || isAnalyzing || uploadStatus.analyzed) && (
        <div className="status-container">
          <h3>Status:</h3>
          <p>{isUploading ? "Mengupload file..." : 
              isAnalyzing ? "Menganalisis file dengan AI..." : 
              uploadStatus.analyzed ? `Analisis selesai. ${uploadStatus.sensitiveFiles.length} file berisi data sensitif.` : 
              uploadStatus.message}
          </p>
          
          {uploadStatus.analyzed && uploadStatus.sensitiveFiles.length > 0 && (
            <div className="sensitive-files-list">
              <h4>File dengan data sensitif:</h4>
              <ul>
                {uploadStatus.sensitiveFiles.map((filename, index) => (
                  <li key={index}>{filename}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}
    </div>
  );
}
